import React from 'react';


function Showcase( {movies} )  {  
  console.log(movies);
  const backdrops = movies.map(movie => {
  	return (  		
  		<img key={movie.id} alt={movie.title} src={`http://image.tmdb.org/t/p/w1280/${movie.backdrop_path}`} />		
  	)   		
  })  
  return(
	  <div className="showcase">
	  	<div className="image-container">	  		
			{backdrops}
	  	</div>


	  </div>
  	)	  
}



export default Showcase;
